import React from 'react';
// import {useStyles} from "./LayoutUseStyles";
import Header from "../_includes/header/Header";
import Drawer from "../_includes/drawer/Drawer";
import Content from "../_includes/content/Content";
import Footer from "../_includes/footer/Footer";

// import {useStyles} from "./LayoutUseStyles";
// import Header from "../_includes/header/Header";
// import Drawer from "../_includes/drawer/Drawer";
// import Content from "../_includes/content/Content";
// import Footer from "../_includes/footer/Footer";

import {makeStyles} from "@material-ui/styles";

const drawerWidth = 240;

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
    },
    appBar: {
        zIndex: theme.zIndex.drawer + 1,
    },
    drawer: {
        width: drawerWidth,
        flexShrink: 0,
    },
    drawerPaper: {
        width: drawerWidth,
    },
    title: {
        flexGrow: 1,
    },
    wrapper: {
        display: 'flex',
        height: '100vh',
        flexDirection: 'column',
        flexGrow: 1,
    },
    content: {
        flexGrow: 1,
        padding: theme.spacing(3),
    },
    toolbar: theme.mixins.toolbar,
}));


export default function Layout(props) {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Header title={props.title} />
            <Drawer />

            <div className={classes.wrapper}>
                {/*<Content inner={props.children} />*/}
                <Footer />
            </div>
        </div>
    );
}
